## Remarks  
 Cuando se trabaja con un valor de propiedad de cadena multivalor, la <xref:System.DirectoryServices.PropertyValueCollection.Remove%2A> método quitará correctamente el elemento correcto. Sin embargo, es difícil con un valor de propiedad DNWithString multivalor que identifica los elementos correctos por su nombre (como la clase COM DNWithString, que se utiliza para almacenar elementos DNWithString, tiene 2 propiedades de cadena que representa el elemento). La forma de quitar estos elementos es encontrar el objeto de la colección (recorriendo en bucle todos los elementos), a continuación, llame a la <xref:System.DirectoryServices.PropertyValueCollection.Remove%2A> función con el puntero del objeto que acaba de encontrar.  Esto se muestra en el ejemplo siguiente.  
  
   
  
## Examples  
  
```csharp  
  
// Bind to the AD object  
DirectoryEntry myUser = new DirectoryEntry("LDAP://AdServer:389/CN=MyUsername,CN=Users,DC=contoso,DC=com");  
  
// Get the attribute  
PropertyValueCollection testAttribute = myUser.Properties["someAttribute"];  
  
// Find the item in the collection that we want to delete  
DNWithString dnwsItemToRemove = null;  
foreach (DNWithString dnwsItem in testAttribute)  
{  
    if (dnwsItem.StringValue.Equals("SomeValue"))  
    {  
        dnwsItemToRemove = dnwsItem;  
        break;  
    }  
}  
  
// Delete it  
testAttribute.Remove(dnwsItemToRemove);  
  
// Store the data  
myUser.CommitChanges();  
```
